import React from 'react';
import styled from 'styled-components';
import { connect } from 'react-redux';

import CollectionItem from '../../components/Collections/Overview';

const Collection = ({
	match: {
		params: { collectionId }
	}
}) => (
	<div>
		<h2>{collectionId.toUpperCase()}</h2>
	</div>
);

export default connect()(Collection);
